import React, { useState } from "react";
import { Button, Modal, OverlayTrigger, Tooltip, Col, Row } from 'react-bootstrap';

const AddTodo = () => {
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <>
      <Row className="mt-5">
      <Col></Col>
          <Col md={2} xs={6} className="ml-2" onClick={handleShow}>
          <OverlayTrigger overlay={<Tooltip id="tooltip-disabled">Add Todo</Tooltip>}>
            <span className="d-inline-block">
              <Button variant="outline-primary" className="btn-add" style={{ pointerEvents: 'none' }}>+</Button>{' '}
            </span>
          </OverlayTrigger>
          </Col>
        </Row>
      <Modal
        show={show}
        onHide={handleClose}
        backdrop="static"
        keyboard={false}
      >
        <Modal.Header closeButton>
          <Modal.Title>Modal title</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          I will not close if you click outside me. Don't even try to press
          escape key.
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>
            Close
          </Button>
          <Button variant="primary">Understood</Button>
        </Modal.Footer>
      </Modal>
    </>
  );
}

export default AddTodo;
